import { GitHub } from "@material-ui/icons";
import MailOutlineIcon from '@material-ui/icons/MailOutline';
import { 
  mdiLanguageTypescript, 
  mdiLanguageJavascript,
  mdiLanguageHtml5,
  mdiChartLineVariant,
  mdiCalendarRange,
  mdiSwapHorizontal,
  mdiLanguageRuby,
  mdiLanguageRubyOnRails,
  mdiCreditCardCheck,
  mdiDatabaseSearch,
  mdiAlphaSBoxOutline,
  mdiAlphaJCircleOutline,
  mdiNodejs,
  // mdiLanguageCss3,
  mdiMaterialUi, 
  mdiReact,
} from '@mdi/js';

let activeRecords, amCharts, axios, dateIO, express, html, js, jest, mui, psql, rails, react, ruby, storyBook, stripe, ts
activeRecords = {
  label : 'ActiveRecords',
  icon: mdiLanguageRubyOnRails
}
amCharts = {
  label:'amCharts',
  icon: mdiChartLineVariant
}
axios = {
  label:'axios',
  icon: mdiSwapHorizontal
}
dateIO = {
  label:'date-io',
  icon: mdiCalendarRange
}
express = {
  label: 'Express',
  icon: mdiNodejs
}
html = {
  label: 'HTML5',
  icon: mdiLanguageHtml5
}
js = {
  label:'Javascript',
  icon: mdiLanguageJavascript,
}
jest = {
  label: 'Jest',
  icon: mdiAlphaJCircleOutline
}
mui = {
  label: 'Material UI', 
  icon: mdiMaterialUi
}
psql = {
  label: 'PostgreSQL', 
  icon: mdiDatabaseSearch 
}
rails ={
  label: 'Rails',
  icon: mdiLanguageRubyOnRails
}
react = {
  label:'React',
  icon: mdiReact
}
ruby = {
  label:'Ruby',
  icon: mdiLanguageRuby
}
storyBook = {
  label:'Storybook',
  icon: mdiAlphaSBoxOutline
}
stripe = {
  label: 'Stripe',
  icon: mdiCreditCardCheck
}
ts = {
  label:'TypeScript',
  icon: mdiLanguageTypescript
}

const links = [
  {
    label: 'Github',
    link: 'https://github.com/jswelsh',
    icon: <GitHub />
  },
  {
    label: 'Email',
    link: 'mailto:james.sinclair.welsh@gmail.com',
    icon: <MailOutlineIcon/>
  }
]

const projects = [
  {
    header: 'CurExC',
    demo: 'https://curexc.web.app/',
    repo: 'https://github.com/jswelsh/currency_converter_v1',
    image: '/public/CurExC.jpeg',
    technologies: [
      {...amCharts}, 
      {...axios}, 
      {...dateIO},
      {...mui}, 
      {...react}, 
      {...ts}, 
    ],
  }, {
    header: 'TransLink',
    demo: 'https://agitated-galileo-f1090b.netlify.app/',
    repo: 'https://github.com/jswelsh/translinkGraph',
    image: null,
    technologies: [
      {...html}, 
      {...js}
    ],
  }, {
    header: 'Jungle',
    demo: null,
    repo: 'https://github.com/jswelsh/jungle',
    image: null,
    technologies: [
      {...activeRecords},
      {...psql},
      {...stripe},
      {...rails},
      {...ruby},
    ], 
  }, {
    header: 'Scheduler',
    demo: null,
    repo: 'https://github.com/jswelsh/scheduler',
    image: null,
    technologies: [
      {...react}, 
      {...axios}, 
      {...storyBook}, 
      {...jest}, 
      {...express}
    ], 
  }
  /* SCSS, JS, React, axios, Storybook, Jest, Express */
