    header: "Never86'd",
    demo: null,
    repo: 'https://github.com/jswelsh/never86-ed',
    image: null,
    technologies: [
      {
        label: 'Ruby',
        icon: 
      }, {
        label: , 
        icon:   
      }
    ], 
  } *//* , {
    header: null,
    demo: null,
    repo: 'https://github.com/jswelsh/translinkGraph',
    image: null,
    technologies: [
      {
        label:,
        icon: 
